import ContactUsSection from "./Components/ContactUs/ContactUsSection.jsx";


function App() {
  return (
    <div className="App">

      <Header/>
      <Hero/>

      <AllPropertiesSection/>
      <ContactUsSection/>

    </div>
  );
}

export default App;
